import logo from './logo.svg';
import './App.css';
import {CardComponent} from './components/Card';
import {Header} from './components/Header';

function App() {
  return (
    <>
        <Header />
        <CardComponent className="card-indiv" title="Robot 1" url="https://robohash.org/user1"/>
        <CardComponent className="card-indiv" title="Robot 2" url="https://robohash.org/user2"/>
        <CardComponent className="card-indiv"title="Robot 3" url="https://robohash.org/user3"/>
        </> 
  );
}

export default App;
